import React from 'react';
import { Table, TableHead, TableHeading, TableBody } from '../../Table';

export interface ProductsTableProps {
  products: any;
}

const ProductsTable: React.SFC<ProductsTableProps> = ({ products }) => {
  return (
    <Table className="table-borderless mb-4">
      <TableHead>
        <TableHeading width={75} />
        <TableHeading>Product</TableHeading>
        <TableHeading>Price</TableHeading>
        <TableHeading>Inventory</TableHeading>
      </TableHead>
      <tbody>
        {products.map((product) => (
          <tr key={product.id}>
            <td>
              <img
                src="https://picsum.photos/50/50"
                style={{ borderRadius: '8px' }}
              />
            </td>
            <td>{product.title}</td>
            <td>${product.price.toFixed(2)}</td>
            <td>{product.inventory} in stock</td>
          </tr>
        ))}
      </tbody>
      <style jsx>{`
        .imageColumn {
          width: 75px !important;
        }
        td {
          vertical-align: middle;
        }
      `}</style>
    </Table>
  );
};

export default ProductsTable;
